import React from "react";
import RatingButton from "./RatingButton";

// function handleSubmit(e){
//   e.preventDefault();
//   console.log(e.target.value);
// }

function Card({question, fsId}) {
  return (
      <div className="card mx-auto bg-[#FFFFFF] rounded-lg text-xl p-6 my-4 w-3/5">
        <div className="px-7">
          <p className="text-left">{question}</p>
        </div>
        
        <div className="overflow-x-auto overflow-y-hidden">
        {/* <form action="" onSubmit={handleSubmit} className="w-full" method="post" enctype="multipart/form-data" id="myForm1"> */}
          <fieldset id={`fs${fsId}`} className="radioGroup flex flex-row justify-around mt-[20px] text-center bg-[#F8F8FB]">
            {/* <div className="radioGroup flex flex-row justify-around mt-[20px] text-center bg-[#F8F8FB]"> */}
              <RatingButton title="Very poor contribution" radioValue="1" fsId={fsId} />
              <RatingButton title="Poor contribution" radioValue="2" fsId={fsId} />
              <RatingButton title="Acceptable contribution" radioValue="3" ifsIdd={fsId} />
              <RatingButton title="Good contribution" radioValue="4" fsId={fsId} />
              <RatingButton title="Excellent contribution" radioValue="5" fsId={fsId} />
            {/* </div> */}
            
          </fieldset>
        {/* </form> */}
        </div>
      </div>
  );
}

export default Card;
